/* 인원 */
.menu_inner .guestnumber {
    position: absolute;
    top: 160px;
    right: 115px;
    border-radius: 30px;
    background-color: #fff;
    box-shadow: 0px 0px 20px rgba(65, 3, 63, 0.15);
}
.menu_inner .guestnumber_wrap {
    position: relative;
    margin:32px;
}
.menu_inner .guestnumber_wrap>li {
    height:71px;
    width:330px;
    margin-bottom: 10px;
}
.menu_inner .guestnumber_wrap>li:nth-of-type(5){
    height:47px;
}
.menu_inner .guestnumber_wrap>li::after{
    position:absolute;
    content:"";
    width:330px;
    height:1px;
    background-color: #cccccc;
    opacity: .3;
    display:block;
    margin: auto;
    margin-top:18px;
}
.menu_inner .guestnumber_wrap>li:last-child::after{
    display:none;
}
.menu_inner .guestnumber_wrap>li>ul{
    display: flex;
}
.menu_inner .guestnumber_wrap>li ul li.txt {

}

.menu_inner .guestnumber_wrap>li ul li.txt ul {
    position:relative;
}

.menu_inner .guestnumber_wrap>li ul li.txt ul li.title {
    font-size:16px;
    font-weight: bold;
    color:#222;
}

.menu_inner .guestnumber_wrap>li ul li.txt ul li.detail {
    font-size:14px;
    color:#717171;
}

.menu_inner .guestnumber_wrap>li ul li.numberbutton {
    position:absolute;
    display:flex;
    margin-top:3px;
    right:0;
    
}

.menu_inner .guestnumber_wrap>li ul li.numberbutton .button__minus {
    position: relative;
    width:30px;
    height:30px;
    border-radius: 100px;
    border:1px solid #cccccc;
    cursor: pointer;
}

.menu_inner .guestnumber_wrap>li ul li.numberbutton .button__minus .material-icons {
    position:absolute;
    top:5px;
    left:5px;
    color:#cccccc;
    font-size:20px;
}
.menu_inner .guestnumber_wrap>li ul li.numberbutton .result{
    position:relative;
    padding: 0 15px;
    top:3px;
    
}
.menu_inner .guestnumber_wrap>li ul li.numberbutton .button__plus {
    position: relative;
    margin:auto;
    margin:auto;
    width:30px;
    height:30px;
    border-radius: 100px;
    border:1px solid grey;
    cursor: pointer;
}

.menu_inner .guestnumber_wrap>li ul li.numberbutton .button__plus .material-icons {
    position:absolute;
    top: 5px;
    left:5px;
    color:grey;
    font-size:20px;
}

.menu_inner .guestnumber_wrap>li.petnumber ul li ul li.detail a{
    color:#222;
    font-weight: bold;
    text-decoration: underline;
}
